import React from 'react';

function PopisBodova() {
    // Pretpostavljamo da će ovo biti dinamički podaci u pravom app
    const korisnici = [
        { ime: 'Ivo Ivić', id: 1 },
        { ime: 'Marko Marić', id: 2 }
    ];

    return (
        <div className="popis-bodova-container">
            <header className="header">
                <h1>Bodovi</h1>
                <button className="icon-button">
                    <i className="star-icon">★</i> {/* Ovdje bi bila prava ikona, npr. iz FontAwesome */}
                </button>
            </header>
            <table className="user-list">
                <thead>
                    <tr>
                        <th>Ime</th>
                        <th>Akcije</th>
                    </tr>
                </thead>
                <tbody>
                    {korisnici.map(korisnik => (
                        <tr key={korisnik.id}>
                            <td>{korisnik.ime}</td>
                            <td>
                                <button className="icon-button">
                                    <i className="edit-icon">✎</i> {/* Zamijenite s pravom ikonom za uređivanje */}
                                </button>
                                <button className="icon-button">
                                    <i className="checkbox-icon">☐</i> {/* Zamijenite s pravom ikonom za checkbox */}
                                </button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default PopisBodova;
